import React from 'react';

import { withRouter } from "react-router-dom";
import { connect } from "unistore/react";
import { actions } from "../store";

class ListDetailDestinasi extends React.Component {

    componentDidMount = () => {
        this.props.kategoriKota()
    }

    render() {
        return (
            <React.Fragment>
                <div>
                    <button onClick={e => this.props.kategoriKota()}>
                        Pencet
                    </button>
                    {this.props.listDestinasi.map((isi,i)=>(
                    <div>
                        <h1> this is caption : {isi.caption}</h1>
                    </div> 
                    ))}
                    {this.props.listHasilTriposo.map((isi,i)=>(
                    <div>
                        <h1> this is name : {isi.name}</h1>
                    </div> 
                    ))}


                </div>
            </React.Fragment>
        )
    }
};

export default connect("listDestinasi, listHasilTriposo, idKota, isLoading", actions)(withRouter(ListDetailDestinasi));
